import ReactDOM from 'react-dom/client';
function Football() {
    const shoot = (a) => {
        alert(a);
    }
    return (
        <>
            <button onClick={() => shoot("Goal!")}>Take the Shot!</button>
            <button onClick={() => shoot("Goal!")}>Take the Shot!</button>
        </>
